  className: string;
}

const Footer: FC<FooterProps> = ({ className }) => {
  return (
    <footer
      className={`body-font bg-slate-500 bg-opacity-10 dark:bg-slate-500 dark:bg-opacity-10 ${className}`}
    >
      <div className="container mx-auto flex flex-col items-center px-5 py-8 sm:flex-row">
        <a className="title-font flex h-10 items-center justify-center font-medium md:justify-start">
          <svg
            xmlns="http://www.w3.org/2000/svg"
            fill="none"
            stroke="currentColor"
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth="2"
            className="bg-button h-10 w-10 rounded-full p-2 text-white"
            viewBox="0 0 24 24"
          >
            <path d="M12 2L2 7l10 5 10-5-10-5zM2 17l10 5 10-5M2 12l10 5 10-5"></path>
          </svg>
          <span className="ml-3 text-xl">
            {t('Provisioning')}
            <small className="block text-xs font-normal">
              {t('Only using strictly necessary cookies. No tracking')}
            </small>
          </span>
        </a>
        <p className="mt-4 text-sm text-gray-500 sm:ml-auto sm:mt-0 sm:border-l-2 sm:border-gray-200 sm:py-2 sm:pl-4 dark:sm:border-gray-700">
          Â© 2022 | v.
          {getVersion()}
        </p>
      </div>
    </footer>
  );
};

export default Footer;
